import React, { useState } from "react";
import "./Diet.css";

const DietForm = ({ formData, handleChange, handleSubmit, loading }) => {
  const units = ["metric", "imperial"];
  const purposes = ["Lose Weight", "Gain Muscle", "Maintain Weight"];
  const dietPreferences = ["Mediterranean", "Vegetarian", "Vegan", "Ketogenic", "Nordic", "Raw food", "Car", "None"];
  const allergies = ["None", "Gluten", "Dairy", "Nuts", "Shellfish"];

  const [useMetric, setUseMetric] = useState(formData.unit === "metric");

  const handleUnitChange = (event) => {
    setUseMetric(event.target.value === "metric");
    handleChange({
      target: {
        name: "unit",
        value: event.target.value,
      },
    });
  };

  return (
    <form onSubmit={handleSubmit} className="form-container">
      <div className="form-group">
        <label>Gender:</label>
        <select
          name="gender"
          value={formData.gender}
          onChange={handleChange}
        >
          <option value="Male">Male</option>
          <option value="Female">Female</option>
        </select>
      </div>
      <div className="form-group">
        <label>Units:</label>
        <select name="unit" value={formData.unit} onChange={handleUnitChange}>
          {units.map((unit) => (
            <option key={unit} value={unit}>
              {unit.charAt(0).toUpperCase() + unit.slice(1)}
            </option>
          ))}
        </select>
      </div>
      {useMetric ? (
        <>
          <div className="form-group">
            <label>Height (cm):</label>
            <input
              type="number"
              name="height"
              value={formData.height}
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label>Weight (kg):</label>
            <input
              type="number"
              name="weight"
              value={formData.weight}
              onChange={handleChange}
            />
          </div>
        </>
      ) : (
        <>
          <div className="form-group">
            <label>Height:</label>
            <input
              type="number"
              name="heightFeet"
              placeholder="Feet"
              value={formData.heightFeet || ""}
              onChange={handleChange}
              style={{ marginRight: "10px", width: "calc(50% - 5px)" }}
            />
            <input
              type="number"
              name="heightInches"
              placeholder="Inches"
              value={formData.heightInches || ""}
              onChange={handleChange}
              style={{ width: "calc(50% - 5px)" }}
            />
          </div>
          <div className="form-group">
            <label>Weight (lbs):</label>
            <input
              type="number"
              name="weightPounds"
              value={formData.weightPounds || ""}
              onChange={handleChange}
            />
          </div>
        </>
      )}
      <div className="form-group">
        <label>Primary Purpose:</label>
        <select
          name="primaryPurpose"
          value={formData.primaryPurpose}
          onChange={handleChange}
        >
          {purposes.map((purpose) => (
            <option key={purpose} value={purpose}>
              {purpose}
            </option>
          ))}
        </select>
      </div>
      <div className="form-group">
        <label>Meals per Day:</label>
        <input
          type="number"
          name="mealsPerDay"
          value={formData.mealsPerDay}
          onChange={handleChange}
        />
      </div>
      <div className="form-group">
        <label>Snacks per Day:</label>
        <input
          type="number"
          name="snacksPerDay"
          value={formData.snacksPerDay}
          onChange={handleChange}
        />
      </div>
      <div className="form-group">
        <label>Diet Preference:</label>
        <select
          name="dietPreference"
          value={formData.dietPreference}
          onChange={handleChange}
        >
          {dietPreferences.map((preference) => (
            <option key={preference} value={preference}>
              {preference}
            </option>
          ))}
        </select>
      </div>
      <div className="form-group">
        <label>Allergy:</label>
        <select
          name="allergy"
          value={formData.allergy}
          onChange={handleChange}
        >
          {allergies.map((allergy) => (
            <option key={allergy} value={allergy}>
              {allergy}
            </option>
          ))}
        </select>
      </div>
      <button type="submit" className="submit-button" disabled={loading}>
        {loading ? "Loading..." : "Submit"}
      </button>
    </form>
  );
};

export default DietForm;
